import React from 'react'
import './Card.css'

export class Card extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        console.log(this.props)
        let img = null;
        {
            if (this.props.status) {
                img = <img className={"picture"} src={this.props.src} alt=""/>
            } else {
                img = '';
            }
        }
        return <div className={'card'}>
            <div className={'item'}>
                {img}
            </div>
        </div>
    }
}
